import React from 'react';

import logo from '../../image/808.jpg'

const Header = () => {
  return (
    <header>
      <div>
        <a href="#t">Movies</a>
        <a href="#t">Series</a>
        <a href="#t">Cartoons</a>
        <a href="#t">Anime</a>
      </div>
      <img src={logo} alt='logo' width={'50px'} />
      <div>
        <a href="#t">history</a>
        <p>808TNMYP808</p>
      </div>
    </header>
  );
};

export default Header;
